//i.imgur.com/QZb5qkH.jpeg"}],Vm=[{name:"DJ Moonlight",img:"https://i.imgur.com/FnyV0lA.jpeg",banner:"",bio:"DJ Moonlight, a trailblazing figure in the electronic music scene, has captivated audiences worldwide with his unique soundscapes and electrifying performances. Born and raised in Berlin, he started his journey as a classical pianist before discovering his passion for electronic music. His sets blend deep house, techno, and ambient music, creating an immersive experience that transports listeners to another realm. With over a decade of experience, DJ Moonlight has played at some of the most prestigious festivals and clubs around the globe, including Tomorrowland, Coachella, and Berghain. His innovative approach to music production has earned him numerous awards and accolades, solidifying his status as a pioneer in the industry.",facebook:"",twitter:"",instagram:"https://www.instagram.com/",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"Alex Johnson, Maria Thompson"},{name:"Lily Sterling",img:"https://i.imgur.com/g0UZimv.jpeg",banner:"",bio:"Lily Sterling is a singer-songwriter whose soulful voice and heartfelt lyrics have resonated with fans across the world. Growing up in Nashville, Tennessee, she was surrounded by music from a young age, learning to play the guitar and piano by the time she was ten. Her music blends elements of country, folk, and pop, creating a sound that is both timeless and contemporary. Lily's debut album, 'Whispers in the Wind,' received critical acclaim for its raw emotion and lyrical depth. She has toured extensively, sharing stages with renowned artists like Taylor Swift and Kacey Musgraves. Known for her authenticity and vulnerability, Lily continues to inspire her fans with her powerful storytelling and captivating performances.",facebook:"https://www.facebook.com/",twitter:"https://x.com/",instagram:"https://www.instagram.com/",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"James Carter, Susan White"},{name:"Aerotype Productions",img:"https://i.imgur.com/trV1UTe.jpeg",banner:"https://i.imgur.com/uJHbdvZ.png",bio:"Aerotype Productions is a hit producer known for his innovative approach to music production and sound design. Producer James 'Aerotype' Smith has revolutionized the electronic music landscape with his genre-defying tracks. His music combines elements of hip-hop, EDM, and cinematic soundscapes, creating an audio-visual experience that is both captivating and immersive. Aerotype Productions has collaborated with top artists like Kendrick Lamar, Skrillex, and The Weeknd, contributing to some of the biggest hits in recent years. His work has been featured in blockbuster films, video games, and major advertising campaigns, making him a household name in the industry. With a commitment to pushing the boundaries of music and technology, Aerotype Productions continues to set new standards in the world of sound.",facebook:"",twitter:"",instagram:"",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"Emily Williams, Daniel Brown"},{name:"Don L",img:"https://i.imgur.com/UqmbO5f.jpeg",banner:"https://i.imgur.com/kJedYiC.jpeg",bio:"Don L, born Donald Ladon in Reno, NV, is a versatile artist whose music spans across indie rock, folk, and hip-hop. His ability to blend these genres seamlessly has set him apart in the music industry. Donald began his career in the underground rap scene, quickly gaining recognition for his unique sound, his breakthrough mixtape, 'Rise of the Don,' highlighted his genre-blending talent. He has toured the world, gracing the stages of renowned festivals such as SXSW, Lollapalooza, and Glastonbury. His dynamic performances and charismatic stage presence have earned him a loyal fan base and critical acclaim. Throughout his career, Don L has received numerous awards for his innovative albums. His dedication to his craft and his ability to connect with listeners on a profound level make him a standout figure in the music world.",facebook:"https://www.facebook.com/",twitter:"",instagram:"https://www.instagram.com/ross_bailey_official/",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"Michael Roberts, Linda Green"},{name:"Shaolin Prince",img:"https://i.imgur.com/a6qtOyO.jpeg",banner:"",bio:"Shaolin Prince, born Marcus Thompson in New York, is a critically acclaimed hip-hop artist known for his peaceful, non-violent messages aimed at teaching kids about peaceful existence and life morals. Growing up in a challenging neighborhood, Marcus found solace in music and martial arts, which influenced his artistic persona. His debut album, 'Peaceful Warrior,' received widespread acclaim for its thoughtful lyrics and positive messages. Shaolin Prince has performed at numerous community events and festivals, using his platform to advocate for peace and education. His music has been praised for its ability to inspire and uplift, making him a beloved figure in the hip-hop community.",facebook:"",twitter:"",instagram:"https://www.instagram.com/shaolin_prince/",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"David Miller, Rachel Adams"},{name:"Raven Songbird",img:"https://i.imgur.com/4hGnwXG.jpeg",banner:"",bio:"Raven Songbird is an R&B singer known for her velvety voice and emotionally charged performances. Born in Atlanta, Georgia, Raven grew up in a musical family and began singing in her local church choir. Her music blends classic R&B with contemporary soul, creating a sound that is both nostalgic and fresh. Her debut album, 'Echoes of Love,' won several awards and solidified her place in the music industry. Raven's ability to convey deep emotion through her music has earned her a dedicated fan base and critical acclaim. She continues to perform and release music that resonates with listeners around the world.",facebook:"https://www.facebook.com/",twitter:"https://x.com/",instagram:"https://www.instagram.com/",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"Robert Johnson, Amanda Black"},{name:"Hiroshi Tanaka",img:"https://i.imgur.com/f1tXmPS.jpeg",banner:"https://i.imgur.com/sUrdiGM.jpeg",bio:"Hiroshi Tanaka is a renowned orchestra composer whose works have been performed by some of the world's leading orchestras. Born in Kyoto, Japan, Hiroshi was introduced to classical music at an early age and quickly developed a passion for composition. He studied at the Tokyo University of the Arts and later at the Juilliard School in New York. Hiroshi's compositions are known for their intricate melodies and emotional depth, drawing inspiration from both Eastern and Western musical traditions. His symphonies and concertos have won numerous awards and have been featured in major concert halls around the world. Hiroshi's contributions to classical music have earned him a reputation as one of the leading composers of his generation.",facebook:"https://www.facebook.com/",twitter:"",instagram:"",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"William Lee, Sarah King"},{name:"Emma Lou James",img:"https://i.imgur.com/Ewi3r3E.jpeg",banner:"",bio:"Emma Lou James is a country singer-songwriter whose heartfelt music has touched the hearts of many. Born and raised in Austin, Texas, Emma Lou grew up surrounded by country music and began writing her own songs as a teenager. Her music combines traditional country sounds with contemporary influences, creating a unique and authentic style. Emma Lou's debut album, 'Heartstrings,' was a commercial success and received critical acclaim for its honest lyrics and catchy melodies. She has toured extensively, performing at major country music festivals and earning a loyal fan base. Emma Lou's down-to-earth personality and genuine love for her craft make her a beloved figure in the country music scene.",facebook:"https://www.facebook.com/",twitter:"https://x.com/",instagram:"https://www.instagram.com/",youtube:"https://www.youtube.com/",spotify:"",apple:"",management:"John Anderson, Emily Davis"}],Gm=[{id:"New York",desc:"Headquartered in the vibrant heart of New York City, the epicenter of music and entertainment, our global footprint includes strategically located offices worldwide. By fostering innovation at the intersection of music and technology, each location is dedicated to providing exceptional service and support, ensuring we remain at the forefront of the industry.",img:"https://i.imgur.com/rseDwDZ.jpeg"},{id:"Miami",desc:"Situated in the vibrant and culturally diverse city of Miami, our office thrives in one of the most influential music hubs in the world. Known for its rich blend of musical genres and a thriving nightlife, Miami is a breeding ground for innovation at the intersection of music and technology. Our Miami team is dedicated to providing exceptional service and support, ensuring we remain at the forefront of the industry within this dynamic landscape.",img:"https://i.imgur.com/moeFGfL.jpeg"},{id:"Los Angeles",desc:"Based in the dynamic and influential city of Los Angeles, our office is located in the heart of the entertainment industry. Renowned for its legendary music scene and home to countless iconic artists and venues, Los Angeles is a pivotal center for musical innovation and creativity. Our LA team is committed to delivering exceptional service and support, ensuring we stay ahead in this ever-evolving industry.",img:"https://i.imgur.com/kGz09mw.jpeg"},{id:"London",desc:"Located in the dynamic and culturally rich city of London, our office is strategically positioned in one of the world's leading hubs for music and entertainment. With a focus on driving innovation at the intersection of music and technology, our London team is committed to delivering exceptional service and support, ensuring we lead the industry globally.",img:"https://i.imgur.com/oQqU0ZJ.jpeg"},{id:"Tokyo",desc:"Positioned in the bustling and innovative city of Tokyo, our office is at the heart of a major global music and enter